import { Box, Typography } from "@mui/material"






export const Feature=({title,text})=>{
    const StylesForSame={
        color:'white',
        textTransform:'capitalize'
    }
    return(
        <>
        <Box>
            <Typography 
            sx={StylesForSame}
            variant="h4"
             
            >
                {title}
            </Typography>

        </Box>
        <Box>
        <Typography
        variant="body1"
        color={'primary'}
        >
                {text}
            </Typography>
        </Box>
        </>
    )
}
